interface IconProps {
  label: string
}

const Icon: React.FC<IconProps> = ({ label }) => {
  switch (label.toLowerCase()) {
    case 'externallink':
      return <ExternalLinkIcon />
    case 'share':
      return <ShareIcon />
    case 'spotify':
      return <SpotifyIcon />
    case 'xbox':
      return <XboxIcon />
    case 'playstation':
      return <PlaystationIcon />
    case 'twitch':
      return <TwitchIcon />
    case 'stackoverflow':
      return <StackOverflowIcon />
    case 'skype':
      return <SkypeIcon />
    case 'viber':
      return <ViberIcon />
    case 'slack':
      return <SlackIcon />
    case 'telegram':
      return <TelegramIcon />
    case 'reddit':
      return <RedditIcon />
    case 'pinterest':
      return <PinterestIcon />
    case 'tumblr':
      return <TumblrIcon />
    case 'tiktok':
      return <TiktokIcon />
    case 'snapchat':
      return <SnapchatIcon />
    case 'youtube':
      return <YoutubeIcon />
    case 'dribble':
      return <DribbleIcon />
    case 'facebook':
      return <FacebookIcon />
    case 'instagram':
      return <InstagramIcon />
    case 'twitter':
      return <TwitterIcon />
    case 'linkedin':
      return <LinkedInIcon />
    case 'github':
      return <GithubIcon />
    case 'discord':
      return <DiscordIcon />
    case 'steam':
      return <SteamIcon />
    case 'messenger':
      return <MessengerIcon />
    case 'whatsapp':
      return <WhatsAppIcon />
    case 'mail':
      return <MailIcon />
    default:
      return null
  }
}

export default Icon
